import React from "react";
import "./Model.css";

interface ModalProps {
  show: boolean;
  onClose: () => void;
  reviews: Review[];
}

const Modal: React.FC<ModalProps> = ({ show, onClose, reviews }) => {
  if (!show) {
    return null;
  }

  return (
    <div className="modal">
      <div className="modal-content">
        <span className="close" onClick={onClose}>&times;</span>
        <h2>口コミ</h2>
        {reviews.map((review) => (
          <div key={review.id} className="review-card">
            <p className="review-rating"><strong>評価:</strong>{review.rating}</p>
            <p className="review-rating"><strong>コメント:</strong>{review.comment}</p>
          </div>
        ))}
      </div>
    </div>
  );
};
export default Modal;
